  `restaurant_id` bigint(20) NOT NULL,
  `location_id` bigint(20) NOT NULL,
  `member_id` int(11) NOT NULL,
  `created_time` datetime NOT NULL,
  `total_amount` float(6,2) NOT NULL,
  `order_status` enum('New','Accepted','Cancelled','Completed') NOT NULL DEFAULT 'New',
  `payment_status` varchar(20) NOT NULL,
  `order_type` enum('Delivery','Pickup') NOT NULL DEFAULT 'Pickup',
  `is_later` enum('N','Y') NOT NULL DEFAULT 'N',
  `delivery_time` datetime NOT NULL,
  `tip` float(6,2) DEFAULT NULL,
  `sub_total` float(6,2) NOT NULL,
  `discount_amount` float(6,2) DEFAULT NULL,
  `tax_amount` float(6,2) DEFAULT '0.00',
  `status` enum('N','Y') DEFAULT 'Y',
  `refund_amount` float(6,2) DEFAULT NULL,
  `delivery_service_amount` float(6,2) DEFAULT NULL,
  `source_type` enum('app','web','facebook') DEFAULT 'web',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=366 DEFAULT CHARSET=latin1;
